import React, { useState } from "react";
import {
  View,
  Text,
  TextInput,
  TouchableOpacity,
  Alert,
  StyleSheet,
  Pressable,
  ScrollView,
  Dimensions,
} from "react-native";
import { API_BASE_URL } from "../../utils/apiConfig";

// ‚úÖ ÌòÑÏû¨ Í∏∞Í∏∞Ïùò ÎÜíÏù¥ Í∞ÄÏ†∏Ïò§Í∏∞
const { height } = Dimensions.get("window");

const SignUp2Screen = ({ navigation }) => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [gender, setGender] = useState("");
  const [nickname, setNickname] = useState("");
  const [birthdate, setBirthdate] = useState("");
  const [address, setAddress] = useState("");

  const validateEmail = (email) => {
    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    return emailRegex.test(email);
  };

  const isValidDate = (date) => {
    const dateRegex = /^\d{4}-\d{2}-\d{2}$/;
    return dateRegex.test(date);
  };

  const handleSignUp = async () => {
    if (!validateEmail(email)) {
      Alert.alert("Ïò§Î•ò", "Ïò¨Î∞îÎ•∏ Ïù¥Î©îÏùº ÌòïÏãùÏùÑ ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.");
      return;
    }

    if (password.length < 6) {
      Alert.alert("Ïò§Î•ò", "ÎπÑÎ∞ÄÎ≤àÌò∏Îäî ÏµúÏÜå 6Ïûê Ïù¥ÏÉÅÏù¥Ïñ¥Ïïº Ìï©ÎãàÎã§.");
      return;
    }

    if (password !== confirmPassword) {
      Alert.alert("Ïò§Î•ò", "ÎπÑÎ∞ÄÎ≤àÌò∏Í∞Ä ÏùºÏπòÌïòÏßÄ ÏïäÏäµÎãàÎã§.");
      return;
    }

    if (!gender || !nickname || !birthdate || !address) {
      Alert.alert("Ïò§Î•ò", "Î™®Îì† ÌïÑÎìúÎ•º ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.");
      return;
    }

    if (!isValidDate(birthdate)) {
      Alert.alert("Ïò§Î•ò", "ÏÉùÎÖÑÏõîÏùºÏùÄ YYYY-MM-DD ÌòïÏãùÏúºÎ°ú ÏûÖÎ†•Ìï¥Ïïº Ìï©ÎãàÎã§.");
      return;
    }

    try {
      const response = await fetch(`${API_BASE_URL}users/`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({
          email,
          password,
          gender,
          nickname,
          birthdate,
          address,
        }),
      });

      const data = await response.json();
      console.log("‚úÖ ÌöåÏõêÍ∞ÄÏûÖ ÏùëÎãµ Îç∞Ïù¥ÌÑ∞:", data);

      if (response.status === 201 && data.status === "success") {
        const { id } = data.data;
        console.log("‚úÖ ÌöåÏõêÍ∞ÄÏûÖ ÏÑ±Í≥µ, id:", id);

        Alert.alert(
          "Ïù¥Î©îÏùºÎ°ú ÎßÅÌÅ¨ Ï†ÑÏÜ°",
          "Ïù¥Î©îÏùºÏóêÏÑú Ïù∏Ï¶ù ÎßÅÌÅ¨Î•º ÌÅ¥Î¶≠ÌïòÏó¨,\nÌöåÏõêÍ∞ÄÏûÖÏùÑ ÏßÑÌñâÌï¥Ï£ºÏÑ∏Ïöî.",
          [
            {
              text: "ÌôïÏù∏",
              onPress: () => navigation.navigate("SignUp3", { email, id }),
            },
          ]
        );
      } else if (response.status === 400 && data.errors?.email) {
        Alert.alert(
          "Ïò§Î•ò",
          "Ïù¥ÎØ∏ Ï°¥Ïû¨ÌïòÎäî Ïù¥Î©îÏùºÏûÖÎãàÎã§. Îã§Î•∏ Ïù¥Î©îÏùºÏùÑ ÏÇ¨Ïö©Ìï¥Ï£ºÏÑ∏Ïöî."
        );
      } else {
        Alert.alert("Ïò§Î•ò", data.message || "ÌöåÏõêÍ∞ÄÏûÖ Ïã§Ìå®");
      }
    } catch (error) {
      console.error("üö® Network Error:", error);
      Alert.alert("Ïò§Î•ò", "ÎÑ§Ìä∏ÏõåÌÅ¨ Ïò§Î•òÍ∞Ä Î∞úÏÉùÌñàÏäµÎãàÎã§.");
    }
  };

  return (
    <View style={styles.container}>
      <TouchableOpacity
        onPress={() => navigation.goBack()}
        style={styles.backButton}
      >
        <Text style={styles.backText}>{"<"}</Text>
      </TouchableOpacity>
      <Text style={styles.title}>ÌöåÏõêÍ∞ÄÏûÖ</Text>

      {/* ‚úÖ Ïä§ÌÅ¨Î°§ Í∞ÄÎä•Ìïú ÏûÖÎ†• ÏòÅÏó≠ */}
      <ScrollView
        style={styles.scrollContainer}
        contentContainerStyle={styles.scrollContent}
      >
        {/* ‚úÖ Ïù¥Î©îÏùº ÏûÖÎ†• */}
        <Text style={styles.label}>Ïù¥Î©îÏùº</Text>
        <TextInput
          style={styles.input}
          placeholder="Ïù¥Î©îÏùº ÏûÖÎ†•"
          placeholderTextColor="#ccc"
          keyboardType="email-address"
          autoCapitalize="none"
          value={email}
          onChangeText={setEmail}
        />

        {/* ‚úÖ ÎπÑÎ∞ÄÎ≤àÌò∏ ÏûÖÎ†• */}
        <Text style={styles.label}>ÎπÑÎ∞ÄÎ≤àÌò∏</Text>
        <TextInput
          style={styles.input}
          placeholder="ÎπÑÎ∞ÄÎ≤àÌò∏ ÏûÖÎ†•"
          placeholderTextColor="#ccc"
          secureTextEntry
          value={password}
          onChangeText={setPassword}
        />

        {/* ‚úÖ ÎπÑÎ∞ÄÎ≤àÌò∏ ÌôïÏù∏ */}
        <Text style={styles.label}>ÎπÑÎ∞ÄÎ≤àÌò∏ ÌôïÏù∏</Text>
        <TextInput
          style={styles.input}
          placeholder="ÎπÑÎ∞ÄÎ≤àÌò∏ ÌôïÏù∏"
          placeholderTextColor="#ccc"
          secureTextEntry
          value={confirmPassword}
          onChangeText={setConfirmPassword}
        />

        {/* ‚úÖ ÏÑ±Î≥Ñ ÏÑ†ÌÉù */}
        <Text style={styles.label}>ÏÑ±Î≥Ñ</Text>
        <View style={styles.genderContainer}>
          <Pressable
            style={[styles.checkBox, gender === "male" && styles.checkedBox]}
            onPress={() => setGender("male")}
          >
            {gender === "male" && <Text style={styles.checkMark}>‚úì</Text>}
          </Pressable>
          <Text style={styles.checkBoxText}>ÎÇ®ÏÑ±</Text>

          <Pressable
            style={[styles.checkBox, gender === "female" && styles.checkedBox]}
            onPress={() => setGender("female")}
          >
            {gender === "female" && <Text style={styles.checkMark}>‚úì</Text>}
          </Pressable>
          <Text style={styles.checkBoxText}>Ïó¨ÏÑ±</Text>
        </View>

        {/* ‚úÖ ÎãâÎÑ§ÏûÑ ÏûÖÎ†• */}
        <Text style={styles.label}>ÎãâÎÑ§ÏûÑ</Text>
        <TextInput
          style={styles.input}
          placeholder="ÎãâÎÑ§ÏûÑ ÏûÖÎ†•"
          value={nickname}
          onChangeText={setNickname}
        />

        {/* ‚úÖ ÏÉùÎÖÑÏõîÏùº ÏûÖÎ†• */}
        <Text style={styles.label}>ÏÉùÎÖÑÏõîÏùº</Text>
        <TextInput
          style={styles.input}
          placeholder="YYYY-MM-DD"
          value={birthdate}
          onChangeText={setBirthdate}
        />

        {/* ‚úÖ Ï£ºÏÜå ÏûÖÎ†• */}
        <Text style={styles.label}>Ï£ºÏÜå</Text>
        <TextInput
          style={styles.input}
          placeholder="Ï£ºÏÜå ÏûÖÎ†•"
          value={address}
          onChangeText={setAddress}
        />
      </ScrollView>

      {/* ‚úÖ Îã§Ïùå Î≤ÑÌäº */}
      <TouchableOpacity style={styles.button} onPress={handleSignUp}>
        <Text style={styles.buttonText}>Ïù∏Ï¶ùÌïòÍ∏∞</Text>
      </TouchableOpacity>
    </View>
  );
};
